import React from 'react';
import { BrowserRouter as Router, Routes, Route, useLocation } from 'react-router-dom';
import './App.css';
import Header from './components/Header';
import HomePage from './components/HomePage';
import AboutPage from './components/AboutPage';
import SolutionPage from './components/SolutionPage';
import Footer from './components/Footer';
import DataAnalyticsDetailsPage from './pages/DataAnalyticsDetailsPage';

function AppContent() {
  const location = useLocation();

  return (
    <div className="App">
      {location.pathname !== '/data-analytics-details' && <Header />}
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/about" element={<AboutPage />} />
          <Route path="/solution" element={<SolutionPage />} />
          <Route path="/data-analytics-details" element={<DataAnalyticsDetailsPage />} />
        </Routes>
      {location.pathname !== '/data-analytics-details' && <Footer />}
    </div>
  );
}

function App() {
  return (
    <Router>
      <AppContent />
    </Router>
  );
}

export default App;
